package aqqje.com.factorybean;import aqqje.com.factory.Car;import org.springframework.beans.factory.FactoryBean;public class CarFactoryBean implements FactoryBean {    private String brank;    public void setBrank(String brank){        this.brank = brank;    }    @Override    public Object getObject() throws Exception {        return new Car(brank, 1000000);    }    @Override    public Class<?> getObjectType() {        return Car.class;    }    @Override    public boolean isSingleton() {        return true;    }}